import React from 'react';
import './student.css';

const StudentLogin = () => {
  return (
    <div className="container">
      <div className="image">
      <img src="/images/pexels-christina-morillo-1181325.jpg" alt="SSome Description" />


      </div>
      <div className="myform">
        <form>
          <h2>STUDENT LOGIN</h2>
          <input type="text" placeholder="Student Name" />
          <input type="password" placeholder="Password" />
          <button type="submit">LOGIN</button>
        </form>
        <a href="forget-password">Forgot my password!</a>
      </div>
    </div>
  );
};

export default StudentLogin;
